    false,nt"url": null,nt"notes": "Laser Mapping Specialist, Inc (LMSI) collected
    230 square miles in the Virginia counties of Fluvanna, Orange, Louisa, and Spotsylvania.
    The nominal pulse spacing for this project was no greater than 0.7 meters. Dewberry
    used proprietary procedures to classify the LAS into an initial ground surface.
    Dewberry used proprietary procedures to classify the LAS and then performed manual
    classifications according to project specifications: 1-Unclassified, 2-Ground, 7-Noise,
    9-Water, and 10-Ignored Ground due to breakline proximity. The LiDAR data were processed
    to a bare-earth digital terrain model (DTM). Detailed breaklines and bare-earth
    Digital Elevation Models (DEMs) were produced for the project area. Deliverables
    were produced in both UTM and State Plane coordinates. The data was formatted according
    to tiles with each UTM tile covering an area of 1,500 meters by 1,500 meters and
    each State Plane tile covering an area of 5,000 feet by 5,000 feet. A total of 320
    UTM tiles and 313 State Plane tiles were produced for the project encompassing an
    area of approximately 230 sq. miles.",nt"license_title": null,nt"extras":
